const Styledli = styled.li`
    list-style-type: none;
    color: #333;
    display: -webkit-box;
    display: -ms-flexbox;
    display: flex;
    cursor: pointer;
    line-height: 1.50;
    font-size: 15px;
    padding-left: 0;
    padding-right: 0;
`

const Styledul = styled.ul`
    ${Styledli}:nth-child(1)${Styledspan}{
        color: #6accbc;
    }
`

const IndividualProject = (props) => {
    return (
      <div>
        <span>â€¢</span>
        <span>{props.name}</span>
        <span
          tabIndex={0}
          role="button"
        >
          <FaTrashAlt />
        </span>
      </div>
    );
  };

const Projects = () => {

  return (
    <Styledul>
        {
        projects.map((project) => (
        <Styledli> 
            <IndividualProject name={project}/>
        </Styledli>
        ))
        }
    </Styledul>
  );
};

export default Projects;
